import React, { Component } from 'react';
import './css/Footer.css';

export class Footer extends Component {

    render() {

        return (
            <footer>
                <div className="cent">
                <div className="icons">
                    <i class="fab fa-linkedin fa-2x"><a href="https://www.linkedin.com/in/sheik-oodally/"></a></i>
                    <i class="fab fa-github fa-2x"></i>
                </div>
                </div>
            </footer>
        )
    }
}

export default Footer;
